import React from 'react';
import '../App.css';
import video from '../../images/twollamavideo.mp4';
import { Button } from "@material-ui/core";
import { Link } from 'react-router-dom'

function Home() {
    return (
        <div className='home'>
            <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', height: '100%' }}>
                <h1 id='text'>Your Llama Adventure Awaits You...</h1>    
                <div style={{ all: 'initial' }}><Button component={Link} to="/widget-page" variant="contained" color="default" size="large"><h3><b>Choose Your Destination</b></h3></Button></div>
            </div>
            <video id='vid' src={video} autoPlay loop muted/>
        </div>
    )
}

export default Home;
